{'id': 29247666, 'body': "Hi,
Sorry to hear you've hit this. It's most likely because iOS crashes that exceeded time doesn't count. These crashes have been found in iOS 12 onwards where apps usually get killed (by the iOS system) and have to restart themselves after users switch to a different app and then switch back, as well as where users tend to find themselves on the home screen of the device after they leave an app in the foreground, lock the screen and then unlock it in a while.

As the issue is from Apple's end, we regret to say that there's nothing we could do on our end at the moment, but we'll keep seeking a way around this. Sorry for any inconvenience caused.", 'modified': '2022-04-19T02:56:30Z'}

