developerResponse:
{'id': 23831133, 'body': 'Hi there, 

Thank you for notifying us of the problem. Currently, if you change the beginning time of a day, it will only change the overview of "Forest". Our home page and the other pages will stay the same. 
However, if the overview page does not change as expected, please contact us via the in-app feedback system. To visit our in-app feedback system, please go to Settings and enter our FAQ first. Once there, please tap on the top-right icon and you should be able to contact us. Thank you and sorry for the inconvenience.Thank you for your understanding.  -Forest', 'modified': '2021-07-09T02:00:09Z'}

