{'id': 27642748, 'body': "Hi, owning to the change in the iOS system, please turn on the Deep Focus Mode at the top of Forest's main screen to make trees wither when you leave Forest.

Make sure your device is secured with a password in the privacy settings, then enable the Deep Focus Mode, and your tree will die when you exit Forest. When the mode is switched off, you can use other apps without affecting your tree.

Note that the mode can only be toggled on or off before a session starts. Don't change your mind halfway! :) Feel free to let us know if you encounter any issues or have other questions. Have a great day! ", 'modified': '2022-01-25T03:46:59Z'}

